    static long mod = 1000000007;
    static long inf = 0xfffffffffffffffL;

    void solve() {
        int n = in.nextInt();
        int p = in.nextInt();
        String s = new StringBuilder(in.next()).reverse().toString();
        if (p == 2 || p == 5) {
            long ans = 0;
            for (int i = 0; i < n; i++) {
                if ((s.charAt(i) - '0') % p == 0) {
                    ans += n - i;
                }
            }
            out.println(ans);
            throw new RuntimeException();
        }
        int[] a = new int[n];
        int[] pow = new int[n + 2];
        pow[0] = 1;
        for (int i = 1; i < n + 2; i++) {
            pow[i] = pow[i - 1] * 10 % p;
        }
        int[] count = new int[p];
        a[0] = (s.charAt(0) - '0') % p;
        count[a[0]]++;
        for (int i = 1; i < n; i++) {
            a[i] = (a[i - 1] + pow[i] * (s.charAt(i) - '0')) % p;
            count[a[i]]++;
        }
        long ans = 0;
        for (int i = 0; i < p; i++) {
            ans += count[i] * (count[i] - 1) / 2;
        }
        ans += count[0];
        out.println(ans - 1);
    }

    static long pow(long a, long b) {
        if (a == 0) {
            return 0;
        }
        long x = 1;
        while (b > 0) {
            if (b % 2 == 1) {
                x = x * a % mod;
                b--;
            } else {
                a = a * a % mod;
                b /= 2;
            }
        }
        return x;
    }

    public static void main(String[]$) {
        new Main().solve();
        out.flush();
    }
