		for (int i = 0; i < n; i++) {
			ans[x[i]] = i;
		}

		int[] ptr = new int[n + 1];
		ptr[0] = 0;
		for (int i = 0; i < n; i++) {
			ptr[i + 1] = sortedX[i] + 1;
		}

		for (int i = 0; i < n * (n - 1); i++) {
			ArrayList<FlowEdge> lst = g.getFlowPath();

			FlowEdge first = lst.get(0);
			FlowEdge last = lst.get(lst.size() - 1);

			int who;

			if (first.to < n + 1) {
				who = first.cap;
			} else {
				who = n - 1 - first.cap;
			}


			int where = last.rev.to - 2 * (n + 1);

//			System.err.println(who + " " + where);

			ans[ptr[where]++] = who;
		}

		for (int i = 0; i < n * n; i++) {
			out.print((ans[i] + 1) + " ");
		}

		out.println();

