                for (int j = 0; j < x; j++)
                    masks[i] |= (1 << (ni() - 1));
            }
            for (i = 0; i < MAXN; i++)
                Arrays.fill(dp[i], -1);
            long ans = go(0, 0);
            if (ans == INF)
                pn(-1);
            else
