                TaskE.Vertex a = vs[in.nextInt() - 1];
                TaskE.Vertex b = vs[in.nextInt() - 1];
                a.adjThey.add(b);
                b.adjThey.add(a);
            }
            root.fillWhenThey(0);
            us.fillWhenUs(0);

