import java.util.Arrays;
import java.util.NoSuchElementException;


public class Main {

  private int LARGE = 100000000;
  private int H, W, h, w;


  private int[][] solve1() {
    int[][] matrix = new int[H][W];
    for (int[] row : matrix) {
      Arrays.fill(row, 1);
    }
    for (int i = h - 1; i < H; i += h) {
      for (int j = 0; j < W; j += w) {
        matrix[i][j] = LARGE + 1;
      }
    }
    for (int i = h - 1; i < H; i += h) {
      for (int j = w - 1; j < W; j += w) {
        matrix[i][j] = -h * w - LARGE;
      }
    }

    return matrix;
  }

  private int[][] solve2() {
    int hw = 10000000;
    int[][] matrix = new int[H][W];
    for (int i = h - 1; i < H; i += h) {
      for (int j = w - 1; j < W; j += w) {
        matrix[i][j] = -hw;
      }
    }
    for (int i = 0; i < H; i += h) {
      for (int j = 0; j < W; j += w) {
        matrix[i][j] = hw - 1;
      }
    }

    return matrix;
  }

  private void solve(FastScanner in, PrintWriter out) {
    H = in.nextInt();
    W = in.nextInt();
    h = in.nextInt();
    w = in.nextInt();
