      out.println("No");
      return;
    }

    int[][] matrix = solve1();
    if (check(matrix)) {
      print(out, matrix);
      return;
    }

    matrix = solve2();
    if (check(matrix)) {
      print(out, matrix);
      return;
    }
    out.println("No");
  }

  private boolean check(int[][] matrix) {

    long sum = 0;
    for (int[] row : matrix) {
      for (int x : row) {
        sum += x;
      }
    }
    return sum > 0;
  }

  private void print(PrintWriter out, int[][] matrix) {
    out.println("Yes");
    for (int[] row : matrix) {
      for (int x : row) {
        out.print(x + " ");
      }
      out.println();
    }
  }

